import "./filterbox.css";
import { SingleFilter } from "../singleFilter/singleFilter";


export const FilterBox = ({ onQueryParametersChange }) => {

    const data = [{Category: "online"}, {Category: "home_tutions"},{Category: "in_person"}, {Category: "home_tutions1"}, {Category: "home_tutions2"},{Category: "home_tutions3"}, {Category: "home_tutions4"}]                

    return (
       <Fragment>
            <h1>Filter</h1>
            <div className="Singlefilter">
            <SingleFilter data={data} filter={"Category"} onQueryParametersChange={onQueryParametersChange} />
            </div>

       </Fragment>

    )
}
